import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import LoginPage from "./Pages/LoginPage";
import MainPage from "./Pages/MainPage";

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/">
            <LoginPage />
          </Route>
          <Route path="/main">
            <MainPage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
